import React from "react";
import ReactDOM from "react-dom";
import { ProfileHome } from "./ProfileHome";

import "./styles.css";

function App() {
  return (
    <div>
      <ProfileHome />
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
